import React, { useEffect, useState } from "react";
import { API_BASE } from "../config/config";
import { Button } from '../components/ui/Button';



const RichiesteLavoroInQuota = () => {
  const [richieste, setRichieste] = useState([]);
  const [provinciaFiltro, setProvinciaFiltro] = useState("");
  const [loading, setLoading] = useState(false);
  const [sbloccate, setSbloccate] = useState({}); // ID richieste sbloccate

  useEffect(() => {
    const fetchRichieste = async () => {
      setLoading(true);
      try {
        const res = await fetch(`${API_BASE}/api/richieste/pubbliche`);
        const data = await res.json();
        setRichieste(data);
      } catch (err) {
        console.error("Errore nel caricamento delle Richieste Lavoro In Quota:", err);
      } finally {
        setLoading(false);
      }
    };

    fetchRichieste();
  }, []);

  const handleSblocca = async (id) => {
    try {
      const res = await fetch(`${API_BASE}/api/sblocca-contatti`, {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify({ richiesta_id: id }),
      });

      const result = await res.json();
      if (result.success) {
        setSbloccate((prev) => ({ ...prev, [id]: true }));
      } else {
        alert("Pagamento non riuscito.");
      }
    } catch (err) {
      console.error("Errore durante lo sblocco:", err);
      alert("Errore di rete durante il pagamento.");
    }
  };

  const richiesteFiltrate = richieste.filter(
    (r) =>
      provinciaFiltro === "" ||
      r.provincia.toLowerCase().includes(provinciaFiltro.toLowerCase())
  );

  return (
    <div style={{ padding: "1rem" }}>
      <h2>📢 Richieste di lavoro in quota</h2>
      <p>
        Visualizza le richieste pubblicate da committenti in tutta Italia. Per vedere i contatti, sblocca la richiesta.
      </p>

      <input
        type="text"
        placeholder="Filtra per provincia (es. Milano)"
        value={provinciaFiltro}
        onChange={(e) => setProvinciaFiltro(e.target.value)}
        style={{ margin: "1rem 0", padding: "0.5rem", width: "100%" }}
      />

      {loading ? (
        <p>⏳ Caricamento richieste...</p>
      ) : richiesteFiltrate.length === 0 ? (
        <p>Nessuna richiesta di lavoro in quota disponibile.</p>
      ) : (
        <ul>
          {richiesteFiltrate.map((r) => (
            <li
              key={r.id}
              style={{
                marginBottom: "1rem",
                border: "1px solid #ccc",
                padding: "1rem",
                borderRadius: "8px",
              }}
            >
              <strong>Categoria:</strong> {r.categoria} <br />
              <strong>Comune:</strong> {r.localita} <br />
              <strong>Data:</strong>{" "}
              {new Date(r.data_inserimento).toLocaleDateString()} <br />

              {sbloccate[r.id] ? (
                <>
                  <strong>Contatto:</strong> {r.nome_committente} <br />
                  <strong>Email:</strong> {r.email} <br />
                  <strong>Telefono:</strong> {r.telefono} <br />
                  <strong>Descrizione:</strong> {r.descrizione}
                </>
              ) : (
                <>
                  <em>🔒 Contatti nascosti. Sblocca per vedere i dettagli.</em>
                  <br />
                  <Button
                    className="mt-2"
                    onClick={() => handleSblocca(r.id)}
                  >
                    🔓 Sblocca contatti
                  </Button>
                </>
              )}
            </li>
          ))}
        </ul>
      )}
    </div>
  );
};

export default RichiesteLavoroInQuota;
